import React, { useState, useEffect } from 'react';
import ApiEndpoints from '../../../api/apiEndpoints';
import { useHistory } from 'react-router-dom';

const UserProfilePage = () => {
    const [userData, setUserData] = useState({
        first_name: '',
        last_name: '',
        email: '',
        bio: '',
        phone_number: '',
        image: null, // Changed to null for better file handling
    });
    const history = useHistory(); // useHistory hook for navigation

    useEffect(() => {
        // Fetch current user data
        const fetchUserData = async () => {
            try {
                const response = await fetch(ApiEndpoints.PROFILE_URL, {
                    headers: {
                        'Authorization': `Bearer ${localStorage.getItem('access_token')}`,
                    },
                });
                if (response.ok) {
                    const data = await response.json();
                    setUserData(data);
                } else {
                    console.error('Failed to fetch user data:', await response.text());
                }
            } catch (error) {
                console.error('There was an error fetching the user data!', error);
            }
        };

        fetchUserData();
    }, []);

    const handleChange = (event) => {
        const { name, value } = event.target;
        setUserData((prevState) => ({
            ...prevState,
            [name]: value,
        }));
    };

    const handleFileChange = (event) => {
        setUserData((prevState) => ({
            ...prevState,
            image: event.target.files[0], // Update the file in state
        }));
    };

    const handleSubmit = async (event) => {
        event.preventDefault();

        const formData = new FormData();
        formData.append('first_name', userData.first_name);
        formData.append('last_name', userData.last_name);
        formData.append('email', userData.email);
        formData.append('bio', userData.bio);
        formData.append('phone_number', userData.phone_number);
        if (userData.image) {
            formData.append('image', userData.image); // Append the file if present
        }

        try {
            const response = await fetch(ApiEndpoints.PROFILE_URL, {
                method: 'PUT',
                body: formData,
                headers: {
                    'Authorization': `Bearer ${localStorage.getItem('access_token')}`,
                    // 'Content-Type': 'multipart/form-data' is not needed as fetch handles it
                },
            });

            if (response.ok) {
                alert('Profile updated successfully!');
                // Redirect or perform other actions if needed
                // history.push('/profile'); // Uncomment if you want to redirect
            } else {
                console.error('Failed to update profile:', await response.text());
            }
        } catch (error) {
            console.error('There was an error updating the profile!', error);
        }
    };

    return (
        <div>
            <h1>Profile</h1>
            <form onSubmit={handleSubmit}>
                <div>
                    <label>
                        First Name:
                        <input
                            type="text"
                            name="first_name"
                            value={userData.first_name}
                            onChange={handleChange}
                            required
                        />
                    </label>
                </div>
                <div>
                    <label>
                        Last Name:
                        <input
                            type="text"
                            name="last_name"
                            value={userData.last_name}
                            onChange={handleChange}
                            required
                        />
                    </label>
                </div>
                <div>
                    <label>
                        Email:
                        <input
                            type="email"
                            name="email"
                            value={userData.email}
                            onChange={handleChange}
                            required
                        />
                    </label>
                </div>
                <div>
                    <label>
                        Bio:
                        <textarea
                            name="bio"
                            value={userData.bio}
                            onChange={handleChange}
                        />
                    </label>
                </div>
                <div>
                    <label>
                        Phone Number:
                        <input
                            type="text"
                            name="phone_number"
                            value={userData.phone_number}
                            onChange={handleChange}
                        />
                    </label>
                </div>
                <div>
                    <label>
                        Image:
                        <input
                            type="file"
                            name="image"
                            onChange={handleFileChange}
                        />
                    </label>
                </div>
                <div>
                    <button type="submit">Update Profile</button>
                </div>
            </form>
        </div>
    );
};

export default UserProfilePage;
